import React from "react";
import './CssForAll.css';
import './EventCard.css'



function EventCard({date, article, title}){
    return(
        <div className='ElementCardContainer'>
            <div className='DateLogoContainer'>
                <div>
                    <img src="https://zupimages.net/up/20/05/1acf.png" alt="logoCircus"/>
                </div>
                <p>{date.slice(8,10)}/{date.slice(5,7)}/{date.slice(2,4)}</p>
            </div>
            <div className='TitleCardContainer'>
                <h3>{title}</h3>
            </div>
            <div className='ArticleContainer'>
                <p>{article}</p>
            </div>    
        </div>
    )
};

export default EventCard ;
